/**
 * Base64 编码的图片资源
 * 用于 Entry 欢迎页的快速加载
 * 
 * 优点：
 * - 无网络请求，首屏加载最快
 * - 避免图片加载延迟
 * - 确保 Entry 动画流畅
 * 
 * 注意：
 * - 请将实际的 Base64 字符串粘贴到下方
 * - 建议先压缩图片以减小体积（推荐使用 TinyPNG）
 * - Logo 建议控制在 10KB 以内
 * - Title 建议控制在 5KB 以内
 */

// Logo 图片 Base64（请替换为实际的 Base64 字符串）
export const LOGO_BASE64 = 'data:image/png;base64,';

// Title 图片 Base64（请替换为实际的 Base64 字符串）
export const TITLE_BASE64 = 'data:image/png;base64,';

/**
 * 使用示例：
 * 
 * import { LOGO_BASE64, TITLE_BASE64 } from '@/constants/base64Images';
 * 
 * <img src={LOGO_BASE64} alt="logo" />
 * <img src={TITLE_BASE64} alt="title" />
 */
